const initialState = {
  goalDate: '',
  bedtimeTarget: '',
  wakeupTarget: '',
  goals: []
}

const deleteGoalReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'DELETE_GOAL':
      return {
        ...state, id: action.id
      }
    default:
      return state
  }
}

export default deleteGoalReducer
